                underlines[i].style.transform = 'translate3d(' + e * 100 + '%,0,0)';
            }
        }
        render() {

    return (
<>

<nav>
<div className="full"></div>
      <div className="underline"></div>
      <div className="underline"></div>
      <div className="underline"></div>
      <a onClick={() => this.handleClick(0)}>Home</a>
      <a onClick={() => this.handleClick(1)}>Videos</a>
      <a onClick={() => this.handleClick(2)}>Playlists</a>
      <a onClick={() => this.handleClick(3)}>Community</a>
      <a onClick={() => this.handleClick(4)}>Channels</a>
      <a onClick={() => this.handleClick(5)}>About</a>
    </nav>
</>

    );
        }
}

export default Header;
